import React, { Component } from "react";
import { Grid, Container } from "semantic-ui-react";
import Filter from "./Filter";
import "./Backpack.css";

class Backpack extends Component {
  render() {
    return (
      <div>
        <Container>
          <Grid
            celled
            divided="vertically"
            style={{ overflow: "auto", minHeight: "700px" }}
          >
            <Grid.Column width={5}>
              <Filter />
            </Grid.Column>
            <Grid.Column width={5}>
              <Filter />
            </Grid.Column>
            <Grid.Column width={5}>
              <Filter />
            </Grid.Column>
          </Grid>
        </Container>
      </div>
    );
  }
}

export default Backpack;
